				const frontmatter = {"layout":"../../layouts/blogPost.astro","title":"Silence HPE G8 servers, for good(ish).","pubDate":"2022-09-09T00:00:00.000Z","description":"Make HPE G8 servers as silent as a normal desktop"};
				const file = "/home/liv/Development/ahwx.org/src/pages/blog/ilo4mod.md";
